import { Toolbar,AppBar,Typography,Container } from '@material-ui/core';

const headerStyle = {
  padding: 20,
};

const Header = () => (

  <AppBar style={headerStyle} position="static">
    <Toolbar>
      <Typography variant="h6" >

        <img src={'https://pigment.github.io/fake-logos/logos/large/color/fast-banana.png'}/>
      </Typography>
    </Toolbar>
  </AppBar>
);

export default Header;
